import { ContextMenu } from "./ContextMenu"
import { save } from "./save"

export const UI = () => {
  const inputStyle = {
    zIndex: 2,
    display: "absolute",
    border: 0,
    margin: "8px 16px",
    width: 100,
    height: 30
  }

  return <div
      style={{
        position: "absolute",
        right: 0,
        width: "100vw",
        height: "100vh",
        zIndex: 1
      }}
    >
    <div
      style={{
        zIndex: -129,
        position: "absolute",
        display: "flex",
        flexDirection: "row",
        width: 100,
        height: 30
      }}
    >
      <input
        type="button"
        value="Save"
        style={inputStyle}
        onClick={save}
      />
    </div>
    <ContextMenu
      first={true}
    />
  </div>
}
